function getLang() {
  let lang = (navigator.languages && navigator.languages[0]) || navigator.language || 'en';
  lang = lang.split('-')[0];
  if(labels.hasOwnProperty(lang)) return lang;
  return 'en';
}
const userLang = getLang();

function renderDT() {
  let html = "<table id='mykr-table' class='display' style='width:100%'><thead><tr>";
  html += "<th class='col-num'>"+labels[userLang].num+"</th><th class='col-han'>"+labels[userLang].han+"</th><th class='col-mykr'>"+labels[userLang].mykr+"</th>";
  html += "</tr></thead><tbody>";
  for(let i=0; i<data.length; ++i) {
    let row = data[i];
    html += "<tr><td class='col-num'>"+row[0]+"</td><td class='col-han'>"+row[1]+"</td><td class='col-mykr'>"+row[2]+"</td></tr>";
  }
  html += "</tbody></table>";
  $("#mykr-table-wrap").html(html);
  $('#mykr-table').DataTable({
    "pageLength": 14,
    "lengthMenu": [ [14, 28, 56, -1], [14, 28, 56, "All"] ],
    "order": [[0, 'asc']],
    responsive: true,
    language: { search: labels[userLang].search }
  });
}

function renderStaticTable(ncol, page, pageLength) {
  let totalRows = Math.ceil(data.length / ncol);
  let totalPages = Math.ceil(totalRows / pageLength);
  if(page < 1) page = 1; if(page > totalPages) page = totalPages;
  let startRow = (page-1)*pageLength*ncol;
  let html = "<table id='mykr-table' class='display' style='width:100%'><thead><tr>";
  for(let i=0;i<ncol;i++) {
    html += "<th class='col-num'>"+labels[userLang].num+"</th><th class='col-han'>"+labels[userLang].han+"</th><th class='col-mykr'>"+labels[userLang].mykr+"</th>";
  }
  html += "</tr></thead><tbody>";
  let shown = 0;
  for(let r=(page-1)*pageLength*ncol; shown<pageLength*ncol && r<data.length; r+=ncol) {
    html += "<tr>";
    for(let c=0; c<ncol; c++) {
      let idx = r+c;
      if(idx<data.length) {
        let row = data[idx];
        html += "<td class='col-num'>"+row[0]+"</td><td class='col-han'>"+row[1]+"</td><td class='col-mykr'>"+row[2]+"</td>";
      } else {
        html += "<td class='col-num'></td><td class='col-han'></td><td class='col-mykr'></td>";
      }
    }
    html += "</tr>";
    shown += ncol;
  }
  html += "</tbody></table>";
  html += "<div style='margin:10px 0;text-align:right;font-size:1em;'>";
  html += "<button id='prevpage'>&lt;</button> ";
  html += "<span id='pagenum'>"+page+" / "+totalPages+"</span> ";
  html += "<button id='nextpage'>&gt;</button></div>";
  $("#mykr-table-wrap").html(html);
  $("#prevpage").on("click",function(){ renderStaticTable(ncol,page-1,pageLength); });
  $("#nextpage").on("click",function(){ renderStaticTable(ncol,page+1,pageLength); });
  $("#rowlength").val(pageLength);
}

function localizeUI() {
  $("#page-title").text(labels[userLang].pageTitle);
  $("#subtitle").text(labels[userLang].syllables);
  $("label[for='colcount']").text(labels[userLang].perRow+":");
}

function addRowLengthMenu() {
  if($("#rowlength").length>0) return;
  var menu = '<select id="rowlength" style="margin-left:14px;">'+
             '<option value="14">14</option>'+
             '<option value="28">28</option>'+
             '<option value="56">56</option>'+
             '<option value="-1">All</option></select>';
  $("#option-row").append(menu);
}

$(document).ready(function() {
  localizeUI();
  addRowLengthMenu();
  renderDT();
  $("#option-msg").text("");
  $("#colcount").val("1");
});
$("#colcount").on('change', function() {
  var ncol = parseInt($(this).val());
  var pageLength = parseInt($("#rowlength").val());
  if(ncol===1) { renderDT(); $("#option-msg").text(""); }
  else { renderStaticTable(ncol, 1, pageLength); $("#option-msg").text("(검색·정렬은 1자 보기에서만 지원)"); }
});
$(document).on('change','#rowlength',function(){
  var ncol = parseInt($("#colcount").val());
  var pageLength = parseInt($(this).val());
  if(ncol===1) {
    var dt = $('#mykr-table').DataTable();
    dt.page.len(pageLength==-1?999999:pageLength).draw();
  } else {
    renderStaticTable(ncol,1,pageLength);
  }
});
</script>
